// src/App.jsx
import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";

import Header from "./components/Header";
import LandingPage from "./pages/LandingPage";
import ProjectDescription from "./pages/ProjectDescription";
import ResearchPage from "./pages/ResearchPage";
import LoginPage from "./pages/LoginPage";
import DataPage from "./pages/DataPage";   // ✅ Import DataPage

function App() {
  return (
    <Router>
      {/* Global Header always visible */}
      <Header />

      {/* Route-based page rendering */}
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/description" element={<ProjectDescription />} />
        <Route path="/research" element={<ResearchPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/dataset" element={<DataPage />} />
        {/* Fallback: redirect unknown routes to home */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
}

console.log({
  HeaderType: typeof Header,
  LandingType: typeof LandingPage,
  DescriptionType: typeof ProjectDescription,
  ResearchType: typeof ResearchPage,
  LoginType: typeof LoginPage,
  DataType: typeof DataPage,
});



export default App;
